import React from "react";
import Dropdown from "./Dropdown";

const ProductsButton = () => {
  const dropdownItems = [
    { label: "Tools" },
    {
      label: "Electric tools",
      submenu: [
        { label: "Lawn mowers" },
        { label: "Chainsaws" },
        { label: "Leaf blowers" },
        { label: "Drills" },
      ],
    },
    { label: "Plants" },
    { label: "Flower pots" },
    { label: "Garden decorations" },
    { label: "Pools & accessories" },
  ];

  return (
    <div className="App">
      <Dropdown items={dropdownItems} />
    </div>
  );
};

export default ProductsButton;
